INSERT INTO people (id, first, middle, last, maiden, nickname, face, sibling_seq, keem_line, husband_line, kemler_line, kaplan_line, interests, education, work, notes1, notes2, notes3, birthdate, birthplace, deathdate_note, gender, origin, family_of_origin, current_location, adopted,direct_bool, hide_bool, last_modified, flag1, flag2, created_at, updated_at, show_on_landing_page) VALUES (237, 'Martin J', NULL, 'Keem', NULL, NULL, NULL, NULL, true,false,false,false, NULL, NULL, 'Farmer, and he worked on the Erie Canal as a foreman and he employed 13 hired men. ', 'Came to America from Alsace Lorraine in 1834. After working on the erie canal where he sustained a fractured leg he came to willink (East Aurora) and was employed by the Elder Hamlin, Father of C.J. Hamlin and came to Sheldon in 1836 and was employed as ', 'foreman by Dr. Ziba Hamillton for a period of 4 years to manage his large holdings. He then went to farming for himself and soon bought a farm in wales, Erie County, NY which became known as the \"Keem homestead\".    ', 'The 1850 census has them as the Keim family.  Burial: St. Cecilia RC Cem., Sheldon, NY    ', '1/16/1811', 'Gunstett, Alsace', '1900', 'M', 'French', 132, NULL,false, true,false, '2012-01-26 21:46:18', 'alsace', 'us', '2005-08-29', now(), true);
